In this post I will discuss why promises are greater than callbacks, and why async/await is better than promises.

If you are a beginner at javascript, callbacks were made for asnychronous operations, which are operations which don't resolve instantly. An example of this would be:

```js
getDataFromServer('posts', posts => {
  // ...
})
```

This is asynchronous because `getDataFromServer` doesn't resolve instantly, and therefore a callback is needed

Now, just for those who don't know, promises are a cleaner way to organise callbacks, and would looks something like this

```js
getDataFromServer('posts')
  .then(posts => {
    // handle posts
  })
  .catch(error => {
    // handle error
  })
```

Overall cleaner and easier to read. Now for a more complex example

### Callbacks

```js
getServerData('posts', data => {
  searchWebsiteFor(data[0].title, post => {
    combineDataOnServer([data, post], newData => {
      getUser(newData.session.user, user => {
        // ...
      })
    })
  })
})
```

Now with error handling, that might look like:

```js
getServerData('posts', data => {
  searchWebsiteFor(data[0].title, post => {
    combineDataOnServer([data, post], newData => {
      getUser(newData.session.user, user => {
        // ...
      }, error => {
        console.log('Error getting server data', error);
      })
    }, error => {
      console.log('Error getting server data', error);
    })
  }, error => {
    console.log('Error getting server data', error);
  })
}, error => {
  console.log('Error getting server data', error);
})
```

or with structured error handling that might look like

```js
const handleError = err => console.log('Error getting server data', error);

getServerData('posts', data => {
  searchWebsiteFor(data[0].title, post => {
    combineDataOnServer([data, post], newData => {
      getUser(newData.session.user, user => {
        // ...
      }, handleError)
    }, handleError)
  }, handleError)
}, handleError)
```

Still very very very **very** ugly and messy code

Now with promises that would look like

```js
getServerData('posts')
  .then(data => Promise.all(data, searchWebsiteFor(data[0].title)))
  .then(args => combineDataOnServer(args))
  .then(newData => getUser(newData.session.user))
  .then(user => {
    // ...
  })
  .catch(err => console.log('Error getting server data', err))
```

or at least thats how I think it works... (might be wrong)

Much better looking code, but there is another measure that we can take! Use async/await, which looks something like this

```js
(async () => {
  try {
    const data = await getServerData('posts')
    const post = await searchWebsiteFor(data[0].title, post)
    const newData = await combineDataOnServer([data, post])
    const user = await getUser(newData.session.user)

    // ...

  } catch (err) {
    console.log('Error getting server data', err)
  }
})();
```

The main advantage of async/await is that it makes non synchronous code look synchronous. The other great part is that error handling is great.

An example of how great async/await is compared to callbacks is with the following:

### callbacks

```js
function getJSON(url, callback) {
  fetch(url).then(res => res.json()).then(callback)
}
```

### Async/Await

```js
const getJSON = async url => await (await fetch(url)).json()
```

Thats a great one liner.

Also, async/await is great in for loops:

```js
(async () => {
  const base = await getJSON('/levels/level-1.json');
  for (const block of base) {
    someFunctionToAddEntity(
      await loadEntity(block.entity),
      await loadEntityPosition(block.entity.position));
  }

  // ...
})
```

The following will stop at every `await` keyword until the promises are resolved, which means working code. Writing that with promises of callbacks would suck.

To sum up, promises are greater than callbacks, but async/await reigns champion for the following reasons:

* Better Error Handling
* Synchronous Looking Code
* Debugging
* More Compact, Easy To Read Code
* Its Just Better

But the only downside I can think of, is if i put the following example into `babel`:

```js
const getJSON = async url => await (await fetch(url)).json()
```

Then ask it to polyfill it to all old browsers, it returns this mess, which I don't quite understand

